import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const PageOne = () => {
  return <div>hohohohhohohoho</div>;
};

const PageTwo = () => {
  return <div>hahahahahahahaha</div>;
};
const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={PageOne} />
          <Route path="/pagetwo" element={PageTwo} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
